import React from "react";
import WOW from "wowjs";
class Content extends React.Component {
  componentDidMount() {
    new WOW.WOW().init();
  }
  render() {
    return (
      <div>
        <div className="center">
          <h1 className="wow flipInY" data-wow-iteration="1">
            Hello World!
          </h1>
          <p>a how to about WOW.js</p>
        </div>
      </div>
    );
  }
}

export default Content;
